import React from 'react';
import Carousel from 'react-bootstrap'

const ScreenshotSlider = ({ imageUrls }) => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        responsive: [
            {
                breakpoint: 768,
                settings: {
                    slidesToShow: 2,
                },
            },
            {
                breakpoint: 480,
                settings: {
                    slidesToShow: 1,
                },
            },
        ],
    };

    return (
        <Slider {...settings}>
            {imageUrls.map((imageUrl, index) => (
                <div key={index}>
                    <img src={imageUrl} alt={`Screenshot ${index + 1}`} />
                </div>
            ))}
        </Slider>
    );
};

export default ScreenshotSlider;
